measurements.description:
Twenty-five crowded flowers on one arching, unsupported 56-cm inflorescence;
 sepals chartreuse, light burgundy midline distal half;
petals slightly recurved, chartreuse, light burgundy midline proximal half;
lip recurved, yellow, spotted burgundy apically, keels bright yellow; 
column light yellow anterior, suffused light burgundy,
anther cap white overlaid burgundy;
substance firm; texture matte.
